#!/usr/bin/env python3

myset = set('ATGTGGG')
myset2 = {'ATGCCT'}

#set ungroups individual characters present in a sequence or string
#if set is defined by the user, the string or sequence is just one set

set_A ={3,14,15,9,26,5,35,9}
set_B ={60,22,14,0,9}
#intersection
intersection=set_A & set_B
print(intersection)
difference=set_A - set_B
print(difference)
union=set_A | set_B
print(union)
sym_diff=set_A ^ set_B
print(sym_diff)
set_dna=set('')
print(set_dna)
#just unique values remain

